import React from 'react'
import Popup from 'reactjs-popup'
import { AxiosResponse } from 'axios';
import sqlFormatter from "sql-formatter";
import './popup.scss';

class Props {
  isOpen: boolean;
  sqlString: AxiosResponse;
}

export function PopupExample(props: Props) {
  const aa = props.sqlString && sqlFormatter.format(props.sqlString.data, {
    language: "sql", // Defaults to "sql"
    indent: "    "   // Defaults to two spaces
  });
  console.log('AAAA', props, aa);

  return (

    <Popup
      modal
      closeOnDocumentClick
      open={props.isOpen}
      closeOnEscape
    >
      <div className="SQLResultDialog">
        <textarea readOnly={true}>{aa}</textarea>
        {/* <button>Download</button> */}
      </div>
    </Popup>)
}
